// SPDX-License-Identifier: MIT
pragma solidity >=0.8.16;
import "./StringUtil.sol";
contract HelloWorld {

    string myName = "Hello World! My name is Feng Wei.";
    
    function myFirstHelloWorld ()public view virtual returns(string memory){

        return myName;
    
    }
}
contract HelloMyWorld is HelloWorld {
    //2.1覆盖合约HelloWorld的函数myFirstHelloWorld
    function myFirstHelloWorld() public view override returns(string memory){
        //调用父合约的函数myFirstHelloWorld获取字符串
        string memory a1 = super.myFirstHelloWorld();
        string memory a2 = "Hello World! My name is Zhang San.";
        string memory a3 = "My class number is 202";
     
        //比较获取的字符串是否等于Hello World! My name is Zhang San.
        bytes memory b1 = bytes(a1);
        bytes memory b2 = bytes(a2);
        bytes memory b3 = bytes(a3);


        if(uint(StringUtil.compare(a1,a2))==0){
            return "It's not me!";
        }
        else{
            string memory result = string(abi.encodePacked(b1,b3));
            return result;
                    
        }

    }
        
}

